import React from 'react';
import movies from '../movies'
import Movie from './Movie'
import Searchbar from "./Searchbar"
function Products(){
   const [query, setQuery] = useState('')
     return (
        <>
        
        <Searchbar />
      <div className="countries-container">
      {movies.map((data)=> 
         
         <Movie 
           id={data.id}
           year={data.year}
           title={data.title}
           poster={data.poster}
           genre={data.genre}
         />
        )}</div>
        
        </>
     )
}

export default Products;
